Winstep Xtreme 18.8 !{Latest} 2018

Winstep Nexus Xtreme&#xA0;is a compact, convenient and beautiful panel for quickly launching programs and opening documents (files, folders) in the style of a panel of a similar purpose in Mac OS.&#xA0;Supports a lot of skins, the choice of sound design.&#xA0;A flexible system of settings and the Russian interface will not leave you indifferent to this program.

Differences from the free version:

The ability to create as many docks as you like
Ability to create multi-level mini-docks (for example, for grouping certain applications into a separate mini-dock)
Panel with tabs - there you can push the Control Panel, Desktop icons, etc.
